script: |
  super -f text -I q11693.spq | sort > q11693.out

inputs:
  - name: q11693.spq
    data: |
      SELECT DISTINCT col2 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT ( NULL ) NOT IN ( - col0 + col1 * - col0 + + col0 ) AND NOT NULL NOT BETWEEN NULL AND NULL;
  - name: tab2

outputs:
  - name: q11693.out
    data: |
